"use strict";

function checkIfPangram(sentence) {
    let res = 0;
    for (let i = 0; i < sentence.length; i++) {
        let c = sentence.charAt(i);
        res |= 1 << (c.charCodeAt(0) - 'a'.charCodeAt(0));
        if (res === 0x3FFFFFF) {
            return true;
        }
    }
    return false;
}
